package sfc

import (
	"github.com/ethereum/go-ethereum/common"
	"github.com/ethereum/go-ethereum/common/hexutil"
)

// GetContractBin is SFC contract genesis implementation bin code
// Has to be compiled with flag bin-runtime
// Built from pano-sfc 4.0.1 (05eba0139d2bac5493c453f04b629e9beeb5be3a)
// Solc version: 0.8.27+commit.40a35a09.Linux.g++
//
// Solc was installed using https://github.com/fabelx/go-solc-select
//
//	go install -v github.com/fabelx/go-solc-select/cmd/gsolc-select@latest
//	go install -v github.com/fabelx/go-solc-select/cmd/solc@latest
//	gsolc-select install 0.8.27
//	gsolc-select use 0.8.27
//
// Commands to compile the SFC:
//
//	make    # to fetch all dependencies in the pano-sfc repo
//	solc --base-path ./ --include-path node_modules --evm-version cancun --optimize --optimize-runs 200  --bin-runtime ./contracts/sfc/SFC.sol
func GetContractBin() []byte {
	return hexutil.MustDecode("")
}

// ContractAddress is the SFC contract address
var ContractAddress = common.HexToAddress("0xfc00face00000000000000000000000000000000")
